import { Link } from 'react-router-dom'

const DashHeader = () => {
  const content = (
    <header>
        <div className="dash-header__container">
            <Link to="/dash">
                <h1 className="dash-header__title">Videos</h1>
            </Link>
            <nav className="dash-header__nav">
                {/* {add nav buttons later} */}
            </nav>
        </div>
    </header>
  )
}

export default DashHeader
